import React, { Component } from 'react';
import { Link } from 'react-router-dom';

class Home extends Component {
    saveCat = (name, image) => {
        fetch('/create', {
            method: 'POST',
            body: JSON.stringify({
                name: name,
                image: image
            }),
            headers: {"Content-Type": "application/json"}
        });
    }
    render() {
        return (
            <div className="App">
                <h1>Project Home</h1>
            </div>
        )
    }
}

export default Home;
